        .header h1 {

            z-index: 1;
        }
        
        .header p {

            position: relative;

        }
        
        .stats {

            gap: 30px;
            margin-top: 20px;
            flex-wrap: wrap;
            position: relative;

        }
        
        .stat-item {
            background: rgba(255,255,255,0.15);
            padding: 20px 30px;
            border-radius: var(--border-radius);
            text-align: center;
            backdrop-filter: blur(10px);
            border: 1px solid rgba(255,255,255,0.2);
            transition: var(--transition);
        }
        
        .stat-item:hover {
            transform: translateY(-5px);
            background: rgba(255,255,255,0.2);
        }
        
        .stat-number {
            font-size: 2.2rem;
            font-weight: bold;
            color: #3498db;
            text-shadow: 0 2px 4px rgba(0,0,0,0.3);
        }
        
        .stat-label {
            margin-top: 8px;
            font-size: 0.9rem;
            text-transform: uppercase;
            letter-spacing: 1px;
        }
        
        .controls {
            padding: 30px;
            background: linear-gradient(to right, #f8f9fa, #e9ecef);
            border-bottom: 2px solid #dee2e6;
        }
        
        .search-container {
            position: relative;
            margin-bottom: 25px;
        }
        
        .search-input {

            border-radius: 30px;

            box-shadow: inset 0 2px 5px rgba(0,0,0,0.1);
        }
        
        .search-input:focus {

        .search-icon {

        .filter-group {

            border: 2px solid #eee;

            background: #f8f9fa;

            transition: var(--transition);

        .filter-select:focus {
            border-color: var(--secondary-color);
            background: white;
        }
        
        .view-toggle {
            display: flex;
            background: var(--primary-color);
            border-radius: 25px;
            overflow: hidden;
            box-shadow: 0 4px 15px rgba(0,0,0,0.2);
        }
        
        .view-btn {
            padding: 12px 20px;
            border: none;
            background: transparent;
            color: rgba(255,255,255,0.7);
            cursor: pointer;
            transition: var(--transition);
            font-weight: 600;
        }
        
        .view-btn.active {
            background: var(--secondary-color);
            color: white;
            box-shadow: inset 0 2px 5px rgba(0,0,0,0.2);
        }
        
        .view-btn:hover:not(.active) {
            background: rgba(255,255,255,0.1);
            color: white;
        }
        
        .gallery {
            padding: 30px;
            min-height: 400px;
        }
        
        .grid-view {
            display: grid;
            grid-template-columns: repeat(auto-fill, minmax(300px, 1fr));
            gap: 25px;
        }
        
        .list-view {
            display: block;
        }
        
        .texture-card {
            background: white;
            border-radius: var(--border-radius);
            overflow: hidden;
            box-shadow: var(--card-shadow);
            transition: var(--transition);
            cursor: pointer;
            position: relative;
        }
        
        .texture-card::before {
            content: '';
            position: absolute;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            background: linear-gradient(45deg, transparent, rgba(52, 152, 219, 0.05), transparent);
            opacity: 0;
            transition: var(--transition);
        }
        
        .texture-card:hover {

            box-shadow: 0 20px 40px rgba(0,0,0,0.2);
        }
        
        .texture-card:hover::before {

            height: 200px;
            background: linear-gradient(45deg, #f0f0f0, #e0e0e0);

            align-items: center;
            justify-content: center;
            overflow: hidden;
        }
        
        .texture-image img {
            max-width: 100%;
            max-height: 100%;
            image-rendering: pixelated;
            transition: var(--transition);
            filter: brightness(1.05);
        }

            transform: scale(1.15);
            filter: brightness(1.1) contrast(1.1);
        }

            border-radius: 50%;

            border: 0;
            right: 0;

        let filteredTextures = [...texturesData];
        let currentPage = 1;
        const itemsPerPage = 24;
        let isGridView = true;
        
        // DOM elementleri
        const searchInput = document.getElementById('searchInput');
        const sizeFilter = document.getElementById('sizeFilter');
        const fileSizeFilter = document.getElementById('fileSizeFilter');
        const textureContainer = document.getElementById('textureContainer');
        const pagination = document.getElementById('pagination');
        const gridViewBtn = document.getElementById('gridViewBtn');
        const listViewBtn = document.getElementById('listViewBtn');
        const loading = document.getElementById('loading');
        
        // Event listeners
        searchInput.addEventListener('input', debounce(filterTextures, 300));
        sizeFilter.addEventListener('change', filterTextures);
        fileSizeFilter.addEventListener('change', filterTextures);
        gridViewBtn.addEventListener('click', () => switchView(true));
        listViewBtn.addEventListener('click', () => switchView(false));
        
        // Debounce function for search
        function debounce(func, wait) {
            let timeout;
            return function executedFunction(...args) {
                const later = () => {
                    clearTimeout(timeout);
                    func(...args);
                };
                clearTimeout(timeout);
                timeout = setTimeout(later, wait);
            };
        }
        
        function filterTextures() {
            const searchTerm = searchInput.value.toLowerCase().trim();
            const sizeFilterValue = sizeFilter.value;
            const fileSizeFilterValue = fileSizeFilter.value;
            
            filteredTextures = texturesData.filter(texture => {
                // Arama filtresi
                const matchesSearch = !searchTerm || 
                    texture.filename.toLowerCase().includes(searchTerm) ||
                    texture.filename.toLowerCase().replace(/_/g, ' ').includes(searchTerm);
                
                // Boyut filtresi
                let matchesSize = true;
                if (sizeFilterValue) {
                    const dimensions = `${texture.width}x${texture.height}`;
                    if (sizeFilterValue === 'other') {
                        matchesSize = !['16x16', '32x32', '64x64'].includes(dimensions);
                    } else {
                        matchesSize = dimensions === sizeFilterValue;
                    }
                }
                
                // Dosya boyutu filtresi
                let matchesFileSize = true;
                if (fileSizeFilterValue) {
                    const size = texture.size;
                    switch (fileSizeFilterValue) {
                        case 'small':
                            matchesFileSize = size < 500;
                            break;
                        case 'medium':
                            matchesFileSize = size >= 500 && size <= 2048;
                            break;
                        case 'large':
                            matchesFileSize = size > 2048;
                            break;
                    }
                }
                
                return matchesSearch && matchesSize && matchesFileSize;
            });
            
            currentPage = 1;
            renderTextures();
            renderPagination();
        }
        
        function switchView(gridView) {
            isGridView = gridView;
            
            gridViewBtn.classList.toggle('active', gridView);
            listViewBtn.classList.toggle('active', !gridView);
            
            textureContainer.className = gridView ? 'grid-view' : 'list-view';
            renderTextures();
        }
        
        function renderTextures() {
            const startIndex = (currentPage - 1) * itemsPerPage;
            const endIndex = startIndex + itemsPerPage;
            const currentTextures = filteredTextures.slice(startIndex, endIndex);
            
            if (currentTextures.length === 0) {
                textureContainer.innerHTML = `
                    <div class="no-results">
                        <div class="no-results-icon">üîç</div>
                        <h3>Sonu√ß bulunamadƒ±</h3>
                        <p>Arama kriterlerinizi deƒüi≈ütirmeyi deneyin</p>
                    </div>
                `;
                return;
            }
            
            textureContainer.innerHTML = currentTextures.map(texture => `
                <div class="texture-card">
                    <div class="texture-image">
                        <img src="${texture.image_url}" 
                             alt="${texture.filename}" 
                             loading="lazy"
                             onerror="this.src='https://via.placeholder.com/64x64/cccccc/666666?text=404'">
                    </div>
                    <div class="texture-info">
                        <div class="texture-name">${texture.filename.replace('.png', '')}</div>
                        <div class="texture-details">
                            <span>üìê ${texture.width}√ó${texture.height}</span>
                            <span class="texture-size">${formatFileSize(texture.size)}</span>
                        </div>
                    </div>
                </div>
            `).join('');
        }
        
        function renderPagination() {
            const totalPages = Math.ceil(filteredTextures.length / itemsPerPage);
            
            if (totalPages <= 1) {
                pagination.innerHTML = '';
                return;
            }
            
            let paginationHTML = '';
            
            // √ñnceki sayfa
            if (currentPage > 1) {
                paginationHTML += `<button class="page-btn" onclick="changePage(${currentPage - 1})">‚Äπ</button>`;
            }
            
            // Sayfa numaralarƒ±
            const maxVisiblePages = 5;
            let startPage = Math.max(1, currentPage - Math.floor(maxVisiblePages / 2));
            let endPage = Math.min(totalPages, startPage + maxVisiblePages - 1);
            
            if (endPage - startPage < maxVisiblePages - 1) {
                startPage = Math.max(1, endPage - maxVisiblePages + 1);
            }
            
            for (let i = startPage; i <= endPage; i++) {
                paginationHTML += `<button class="page-btn ${i === currentPage ? 'active' : ''}" onclick="changePage(${i})">${i}</button>`;
            }
            
            // Sonraki sayfa  
            if (currentPage < totalPages) {
                paginationHTML += `<button class="page-btn" onclick="changePage(${currentPage + 1})">‚Ä∫</button>`;
            }
            
            pagination.innerHTML = paginationHTML;
        }
        
        function changePage(page) {
            currentPage = page;
            renderTextures();
            renderPagination();
            window.scrollTo({ top: 0, behavior: 'smooth' });
        }
        
        function formatFileSize(bytes) {
            if (bytes < 1024) return bytes + ' B';
            if (bytes < 1024 * 1024) return Math.round(bytes / 1024) + ' KB';
            return Math.round(bytes / (1024 * 1024)) + ' MB';
        }
        
        // Sayfa y√ºklendiƒüinde
        document.addEventListener('DOMContentLoaded', () => {
            // Kƒ±sa bir gecikme ile loading'i gizle
            setTimeout(() => {
                loading.style.display = 'none';
                textureContainer.style.display = 'grid';
                renderTextures();
                renderPagination();
            }, 1000);
        });
        
        // Klavye kƒ±sayollarƒ±
        document.addEventListener('keydown', (e) => {
            if (e.key === 'f' && e.ctrlKey) {
                e.preventDefault();
                searchInput.focus();
            }
            if (e.key === '/' && !e.ctrlKey && !e.shiftKey && !e.altKey) {
                e.preventDefault();
                searchInput.focus();
            }
        });
        
        // PWA √∂zellikleri i√ßin
        if ('serviceWorker' in navigator) {
            window.addEventListener('load', () => {
                navigator.serviceWorker.register('./sw.js').catch(() => {
                    // Service worker yok, sorun deƒüil
                });
            });
        }
    </script>
</body>
</html>
